import React,{useState} from 'react'
import { BrowserRouter as Router,Route,useHistory} from 'react-router-dom'
import SideNav, { Toggle, Nav, NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';

// Be sure to include styles at some point, probably during your bootstraping
import '@trendmicro/react-sidenav/dist/react-sidenav.css'; 
import FeedBack from './FeedBack';
import Register from './Register';
import { Icon } from 'semantic-ui-react';
import LandlordProfile from './LandlordProfile';
const SidebarExampleTransitions=()=>{
 const history = useHistory()
  const [activeItem, setActiveItem] = useState({
    name: 'listing'
  })

  const handleItemClick = (e, { name }) => {
    setActiveItem(name)
  }
  return (
    <div>
      <Router>
    <Route render={({ location, history }) => (
        <React.Fragment>
      <SideNav
     onSelect={(selected) => {
      const to = '/' + selected;
      if (location.pathname !== to) {
          history.push(to);
      }
  }}
  style={{marginTop:"70px"}}
  expanded
>
    <SideNav.Toggle />
    <SideNav.Nav defaultSelected="home">
        <NavItem eventKey="home">
            <NavIcon>
            <Icon name='home'/>
            </NavIcon>
            <NavText>
                Home
            </NavText>
        </NavItem>
        <NavItem eventKey="feedback">
            <NavIcon>
            <Icon name='home'/>
            </NavIcon>
            <NavText>
                feedback
            </NavText>

        </NavItem>
        <NavItem eventKey="houses">
            <NavIcon>
            <Icon name='home'/>
            </NavIcon>
            <NavText>
                Houses
            </NavText>

        </NavItem>
    </SideNav.Nav>
</SideNav>
<main>
                <Route path="/register" component={props => <Register />} />
                <Route path="/home" component={props => <FeedBack />} />
                <Route path="/managelisting"><LandlordProfile/></Route>
            </main>
        </React.Fragment>
    )}
    />
</Router>
    </div>
  )
}

export default SidebarExampleTransitions
